import React, { useState, ChangeEvent } from 'react';

// Extending our existing interfaces
interface PersonalInfo {
  name: string;
  lastName: string;
  dateOfBirth: string;
  gender: string;
  countryOfOrigin: string;
  phoneNumber: string;
  emailAddress: string;
  address: string;
}

interface ORIA {
  checked: boolean;
  affordableHousing: boolean;
  teenKidCloset: boolean;
  medical: boolean;
  other: boolean;
}

interface EMM {
  checked: boolean;
}

interface InternalReferral {
  checked: boolean;
  economicEmpowerment: boolean;
  womensEmpowerment: boolean;
  youthEmpowerment: boolean;
}

interface ProgramEligibility {
  receivingServices: boolean;
  isOver16: boolean;
  livesInWashington: boolean;
  arrivedAfterJuly2021: boolean;
  hasApprovedStatus: boolean;
  consentFormCompleted: boolean;
  releaseFormCompleted: boolean;
  immigrationStatusCollected: boolean;
}

interface ServicesNeeded {
  housing: boolean;
  employmentFinancials: boolean;
  medical: boolean;
  assistanceServices: boolean;
  other: boolean;
}

interface FormData {
  intakeDate: string;
  navigatorName: string;
  oria: ORIA;
  emm: EMM;
  internalReferral: InternalReferral;
  personalInfo: PersonalInfo;
  immigrationStatus: string;
  dateGranted: string;
  alienNumber: string;
  eligibilityDate: string;
  programEligibility: ProgramEligibility;
  servicesNeeded: ServicesNeeded;
}

const immigrationStatusOptions = [
  'Refugee',
  'Asylum (Approved and granted)',
  'Cuban and Haitian entrants',
  'Amerasians',
  'Certified victims of human trafficking',
  'Iraqi and Afghan Special Immigrants',
  'Afghan Humanitarian Parolees',
  'Afghans with Special Immigrant Parole (SI/SQ Parole) or Special Immigrant',
  'Ukrainian Humanitarian Parolees'
] as const;

const ThriveIntakeForm = () => {
  const [formData, setFormData] = useState<FormData>({
    intakeDate: '',
    navigatorName: '',
    oria: {
      checked: false,
      affordableHousing: false,
      teenKidCloset: false,
      medical: false,
      other: false
    },
    emm: {
      checked: false
    },
    internalReferral: {
      checked: false,
      economicEmpowerment: false,
      womensEmpowerment: false,
      youthEmpowerment: false
    },
    personalInfo: {
      name: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      phoneNumber: '',
      emailAddress: '',
      address: ''
    },
    immigrationStatus: '',
    dateGranted: '',
    alienNumber: '',
    eligibilityDate: '',
    programEligibility: {
      receivingServices: false,
      isOver16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      hasApprovedStatus: false,
      consentFormCompleted: false,
      releaseFormCompleted: false,
      immigrationStatusCollected: false
    },
    servicesNeeded: {
      housing: false,
      employmentFinancials: false,
      medical: false,
      assistanceServices: false,
      other: false
    }
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value, type } = e.target;
    const checked = (e.target as HTMLInputElement).checked;

    if (name.includes('.')) {
      const [section, field] = name.split('.');
      setFormData(prev => {
        const sectionKey = section as keyof FormData;
        const sectionData = prev[sectionKey];

        if (sectionData && typeof sectionData === 'object') {
          return {
            ...prev,
            [section]: {
              ...sectionData,
              [field]: type === 'checkbox' ? checked : value
            }
          };
        }
        return prev;
      });
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: type === 'checkbox' ? checked : value
      }));
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-4">
      {/* Previous sections remain the same... */}

      {/* Immigration Status Section */}
      <div className="border p-4 rounded space-y-4 mt-6">
        <h2 className="font-bold text-lg">CURRENT IMMIGRATION STATUS</h2>

        <div className="space-y-2">
          {immigrationStatusOptions.map((status) => (
            <label key={status} className="flex items-center">
              <input
                type="radio"
                name="immigrationStatus"
                value={status}
                checked={formData.immigrationStatus === status}
                onChange={handleChange}
                className="mr-2"
              />
              <span>{status}</span>
            </label>
          ))}
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
          <div>
            <label className="block text-sm font-medium mb-1">Date Granted (if asylum)</label>
            <input
              type="date"
              name="dateGranted"
              value={formData.dateGranted}
              onChange={handleChange}
              className="w-full p-2 border rounded"
            />
          </div>
          <div>
            <label className="block text-sm font-medium mb-1">Alien #</label>
            <input
              type="text"
              name="alienNumber"
              value={formData.alienNumber}
              onChange={handleChange}
              className="w-full p-2 border rounded"
            />
          </div>
          <div>
            <label className="block text-sm font-medium mb-1">Eligibility Date</label>
            <input
              type="date"
              name="eligibilityDate"
              value={formData.eligibilityDate}
              onChange={handleChange}
              className="w-full p-2 border rounded"
            />
          </div>
        </div>
      </div>

      {/* Program Eligibility Section */}
      <div className="border p-4 rounded space-y-4 mt-6">
        <h2 className="font-bold text-lg">PROGRAM ELIGIBILITY DETERMINATION (DSHS ONLY)</h2>

        <div className="space-y-2">
          <label className="flex items-center">
            <input
              type="checkbox"
              name="programEligibility.receivingServices"
              checked={formData.programEligibility.receivingServices}
              onChange={handleChange}
              className="mr-2"
            />
            <span>Is the participant receiving services from resettlement agencies?</span>
          </label>

          <label className="flex items-center">
            <input
              type="checkbox"
              name="programEligibility.isOver16"
              checked={formData.programEligibility.isOver16}
              onChange={handleChange}
              className="mr-2"
            />
            <span>Is the participant 16 years of age or older?</span>
          </label>

          <label className="flex items-center">
            <input
              type="checkbox"
              name="programEligibility.livesInWashington"
              checked={formData.programEligibility.livesInWashington}
              onChange={handleChange}
              className="mr-2"
            />
            <span>Does the participant live in Washington?</span>
          </label>

          <label className="flex items-center">
            <input
              type="checkbox"
              name="programEligibility.arrivedAfterJuly2021"
              checked={formData.programEligibility.arrivedAfterJuly2021}
              onChange={handleChange}
              className="mr-2"
            />
            <span>Did the participant arrive in the United States on or after July 1, 2021?</span>
          </label>

          <label className="flex items-center">
            <input
              type="checkbox"
              name="programEligibility.hasApprovedStatus"
              checked={formData.programEligibility.hasApprovedStatus}
              onChange={handleChange}
              className="mr-2"
            />
            <span>Does the participant have an approved immigration status?</span>
          </label>
        </div>
      </div>

      {/* Services Needed Section */}
      <div className="border p-4 rounded space-y-4 mt-6">
        <h2 className="font-bold text-lg">WHAT SERVICES IS PARTICIPANT IN NEED OF?</h2>

        <div className="space-y-2">
          {Object.entries(formData.servicesNeeded).map(([service, checked]) => (
            <label key={service} className="flex items-center">
              <input
                type="checkbox"
                name={`servicesNeeded.${service}`}
                checked={checked}
                onChange={handleChange}
                className="mr-2"
              />
              <span>{service.charAt(0).toUpperCase() + service.slice(1).replace(/([A-Z])/g, ' $1')}</span>
            </label>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ThriveIntakeForm;
